import React from "react";

function MoonPhases(props) {
    console.log(props)
    return (
        <>
        {Object.values(props.phases).map((phase) => {
            return (
                <div>
                <p>{phase.phase}</p>
                <p>{phase.date}</p>
                </div>
            );
        })}
        </>
    )
} 

export default MoonPhases;
